import React, { useCallback } from "react";
import { useDispatch } from "react-redux";

import * as Styled from "./style";
import { SIGN_IN } from "../../../reducers/sign";
import SignUpForm from "../../organisms/SignForm/SignUpForm";
import Title, { Size, Weight } from "../../atoms/Title";

const SignUp = () => {
  const dispatch = useDispatch();

  const onClickLogin = useCallback((e) => {
    e.preventDefault();
    dispatch({ type: SIGN_IN });
  }, []);

  return (
    <Styled.SignContainer>
      {/* <Title className="mb40 textCenter" size={Size.m} weight={Weight.m}>
        이메일<span>과</span> 비밀번호
        <span>
          를 <br />
          알려주세요!
        </span>
      </Title> */}
      <SignUpForm />
      <Styled.SignMenu>
        <a>비밀번호찾기</a>
        <a onClick={onClickLogin}>로그인</a>
      </Styled.SignMenu>
    </Styled.SignContainer>
  );
};

export default SignUp;
